import React, { useState } from "react";
import PieChartFood from "./PieChartFood";
import PieChartBeverage from "./PieChartBeverage";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import QuarterlyTrendChart from "./QuarterlyTrendChart";
import logo from "../assets/inflight-logo.png";

const Dashboard = () => {
  const [searchRoute, setSearchRoute] = useState("");
  const [selectedSearchRoute, setSelectedSearchRoute] = useState(null);

  const handleSearch = () => {
    setSelectedSearchRoute(searchRoute);
  };

  const handleBack = () => {
    setSelectedSearchRoute(null);
  };

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: "1rem", background: "linear-gradient(to bottom right, #e0f7fa, #dcedc8)" }}>
      {/* Header */}
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", marginBottom: "1rem" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={logo} alt="In-Flight Insights Logo" style={{ height: "48px", marginRight: "10px" }} />
          <h1 style={{ color: "#1d4ed8", fontSize: "24px" }}>‚úàÔ∏è In-Flight Insights Dashboard</h1>
        </div>

        {/* Search */}
        <div style={{ display: "flex", alignItems: "center", gap: "0.5rem" }}>
          <input
            type="text"
            placeholder="Enter Flight Route"
            value={searchRoute}
            onChange={(e) => setSearchRoute(e.target.value)}
            style={{
              padding: "6px",
              borderRadius: "4px",
              border: "1px solid #ccc"
            }}
          />
          <button
            onClick={handleSearch}
            style={{
              padding: "6px 12px",
              backgroundColor: "#2563eb",
              color: "white",
              border: "none",
              borderRadius: "4px",
              cursor: "pointer"
            }}
          >
            Search
          </button>
          <div style={{ display: "flex", gap: "1rem", marginLeft: "2rem" }}>
            <a href="#dashboard" style={{ color: "#2563eb", fontWeight: "bold" }}>Dashboard</a>
            <a href="#reports" style={{ color: "#2563eb", fontWeight: "bold" }}>Reports</a>
            <a href="#settings" style={{ color: "#2563eb", fontWeight: "bold" }}>Settings</a>
            <a href="#profile" style={{ color: "#2563eb", fontWeight: "bold" }}>Profile</a>
          </div>
        </div>
      </div>

      {/* KPI Cards */}
      <div style={{ display: "flex", justifyContent: "space-around", marginBottom: "1rem" }}>
        {[
          { label: "üí∞ Cost Savings", value: "$1.2M" },
          { label: "‚ôªÔ∏è Waste Saved", value: "210 kg" },
          { label: "‚úàÔ∏è Routes Analyzed", value: "350" },
          { label: "üåç CO‚ÇÇ Saved", value: "28 tonnes" }
        ].map((kpi, idx) => (
          <div key={idx} style={{
            background: "linear-gradient(to right, #d3f9d8, #d0f0fd)",
            borderRadius: "10px",
            padding: "1rem 1.5rem",
            minWidth: "220px",
            textAlign: "center",
            boxShadow: "0 2px 5px rgba(0,0,0,0.1)"
          }}>
            <h3 style={{ fontSize: "18px", fontWeight: "bold" }}>{kpi.label}</h3>
            <p style={{ fontSize: "24px", fontWeight: "bold", margin: 0 }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Quarterly Search Result Chart + Back Button */}
      {selectedSearchRoute && (
        <div style={{ marginBottom: "2rem" }}>
          <QuarterlyTrendChart flightRoute={selectedSearchRoute} />
          <div style={{ textAlign: "center", marginTop: "1rem" }}>
            <button
              onClick={handleBack}
              style={{
                padding: "8px 16px",
                backgroundColor: "#e0e0e0",
                border: "none",
                borderRadius: "6px",
                cursor: "pointer",
                fontWeight: "bold"
              }}
            >
              ‚Üê Back to Overview
            </button>
          </div>
        </div>
      )}

      {/* Consumption Breakdown + Route Trend */}
      <div style={{ display: "flex", gap: "1rem", marginBottom: "1rem" }}>
        <div style={{ flex: 1, backgroundColor: "#f9f9f9", padding: "1rem", borderRadius: "12px" }}>
          <h3 style={{ textAlign: "center" }}>Consumption Breakdown</h3>
          <div style={{ display: "flex", justifyContent: "space-around" }}>
            <div>
              <h4 style={{ textAlign: "center" }}>Food</h4>
              <PieChartFood />
            </div>
            <div>
              <h4 style={{ textAlign: "center" }}>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>
        <div style={{ flex: 1, backgroundColor: "#f9f9f9", padding: "1rem", borderRadius: "12px" }}>
          <RouteLineChart />
        </div>
      </div>

      {/* Bar Chart & Age Group Details */}
      <div>
        <BarChartComponent />
        <AgeGroupDetails />
      </div>
    </div>
  );
};

export default Dashboard;
